s starting to change. Frontier models can now connect directly to lab automation, propose experiments, run them at scale, learn from the results, and decide what to do next. In much of life science, the bottleneck is iteration, and autonomous labs are built to remove that constraint.\"]}]]}]]}]}],[\"$\",\"div\",\"2\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"In earlier work, we showed that GPT5 could \"]}]]}],[\"$\",\"$L2f\",\"1\",{\"href\":\"/index/accelerating-biological-research-in-the-wet-lab/\",\"className\":\"text-primary-100 hover:text-primary-60 relative underline-offset-[0.25rem] decoration-1 underline\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"improve wet-lab protocols\"]}]]}]]}],[\"$\",\"$46\",\"2\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\" through closed-loop experimentation. Here, we show that the same approach can reduce the cost of protein production. \"]}]]}]]}]}],[\"$\",\"div\",\"3\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"We partnered with \"]}]]}],[\"$\",\"$L2f\",\"1\",{\"href\":\"https://www.ginkgo.bio\",\"external\":true,\"className\":\"text-primary-100 hover:text-primary-60 relative underline-offset-[0.25rem] decoration-1 underline\",\"children\":[[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"Ginkgo Bioworks\"]}]]}]],\"\"]}],[\"$\",\"$46\",\"2\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\" to connect GPT5 to a cloud laboratoryan automated wet lab run remotely through software, where robots execute experiments and return dataand used that lab-in-the-loop setup to optimize a widely used biological process: cell-free protein synthesis (CFPS). Over six rounds of closed-loop experimentation, the system tested more than 36,000 unique CFPS reaction compositions across 580 automated plates. After being provided access to a computer, a web browser, and access to relevant papers, GPT5 took three rounds of experimentation to establish a new state of the art in low-cost CFPS, achieving a 40% reduction in protein production cost (and a 57% improvement in the cost of reagents), including novel reaction compositions that are more robust to reaction conditions common in autonomous labs.\"]}]]}]]}]}],[\"$\",\"div\",\"4\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-xl\",\"children\":[\"$\",\"$L47\",null,{\"text\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"Why cell-free protein synthesis matters\"]}]]}]],\"headlineTag\":\"h2\",\"headlineStyleDefault\":\"Heading 3\",\"id\":\"why-cell-free-protein-synthesis-matters\",\"omitFromTableOfContents\":false}]}],[\"$\",\"div\",\"5\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"Cell-free protein synthesis (CFPS) is a way to make proteins without growing living cells. Instead of putting DNA into cells and waiting for them to produce a protein, CFPS runs the protein-making machinery in a controlled mixture. That makes it a practical tool for rapid prototyping and testing as scientists can run many experiments quickly and measure results the same day.\"]}]]}]]}]}],[\"$\",\"div\",\"6\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"Proteins are a big part of what modern biology delivers. Many important medicines are based on proteins. Many diagnostics and research assays depend on proteins. In industrial settings, proteins act as enzymes that make chemical processes cleaner and more efficient. Proteins are even found in your laundry detergent. When protein production becomes faster and cheaper, scientists can usually test more ideas sooner, and reduce the cost of turning early research into something that people can benefit from everyday.\"]}]]}]]}]}],[\"$\",\"div\",\"7\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"CFPS is already useful for that kind of iteration. The bottleneck is that it is tricky to optimize and gets expensive at scale.\"]}]]}]]}]}],[\"$\",\"div\",\"8\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-xl\",\"children\":[\"$\",\"$L47\",null,{\"text\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"Cell-free protein synthesis is difficult to optimize and costly\"]}]]}]],\"headlineTag\":\"h2\",\"headlineStyleDefault\":\"Heading 3\",\"id\":\"cell-free-protein-synthesis-is-difficult-to-optimize-and-costly\",\"omitFromTableOfContents\":false}]}],[\"$\",\"div\",\"9\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"Cell-free protein synthesis requires complex, interacting ingredients: the DNA template encoding the protein to be made, the cell lysate (the soup of cellular machinery from inside cells), and a large number of biochemical components ranging from energy sources to salts. It is incredibly difficult to reason about the system as a whole, and \"]}]]}],[\"$\",\"$L2f\",\"1\",{\"href\":\"https://pubmed.ncbi.nlm.nih.gov/21520017/\",\"external\":true,\"className\":\"text-primary-100 hover:text-primary-60 relative underline-offset-[0.25rem] decoration-1 underline\",\"children\":[[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"many\"]}]]}]],\"\"]}],[\"$\",\"$46\",\"2\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\" \"]}]]}],[\"$\",\"$L2f\",\"3\",{\"href\":\"https://www.nature.com/articles/s41467-020-15798-5?utm_source=chatgpt.com\",\"external\":true,\"className\":\"text-primary-100 hover:text-primary-60 relative underline-offset-[0.25rem] decoration-1 underline\",\"children\":[[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"previous\"]}]]}]],\"\"]}],[\"$\",\"$46\",\"4\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\" \"]}]]}],[\"$\",\"$L2f\",\"5\",{\"href\":\"https://www.nature.com/articles/s41467-025-58139-0?utm_source=chatgpt.com\",\"external\":true,\"className\":\"text-primary-100 hover:text-primary-60 relative underline-offset-[0.25rem] decoration-1 underline\",\"children\":[[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"studies\"]}]]}]],\"\"]}],[\"$\",\"$46\",\"6\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\" have applied different types of machine learning to reduce protein production cost.\"]}]]}]]}]}],[\"$\",\"div\",\"10\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"Standard cell-free protein synthesis (CFPS) formulations and commercial kits are often priced for human-paced work. Autonomous labs can run thousands of reactions in the time a human team might run dozens. At that scale, the cost of reagents becomes the limiting factor.\"]}]]}]]}]}],[\"$\",\"div\",\"11\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"CFPS is also difficult to optimize by intuition alone. Its a mixture of many interacting components. Small changes can matter, but the direction of the effect isnt always obvious, and the best combinations can be hard to find without running a lot of experiments. Prior approaches have reduced costs, but progress tends to be incremental because exploring the space thoroughly is labor-intensive.\"]}]]}]]}]}],[\"$\",\"div\",\"12\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-xl\",\"children\":[\"$\",\"$L47\",null,{\"text\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"Connecting GPT5 to a robotic lab\"]}]]}]],\"headlineTag\":\"h2\",\"headlineStyleDefault\":\"Heading 3\",\"id\":\"connecting-gpt-5-to-a-robotic-lab\",\"omitFromTableOfContents\":false}]}],[\"$\",\"div\",\"13\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"We paired GPT5 with Ginkgo Bioworks cloud laboratory to form a closed-loop autonomous system for cell-free protein synthesis (CFPS) optimization.\"]}]]}]]}]}],[\"$\",\"div\",\"14\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"GPT5 designed batches of experiments. The lab executed them. The results were fed back to the model. The model used that data to propose the next round. We repeated that cycle six times.\"]}]]}]]}]}],[\"$\",\"div\",\"15\",{\"className\":\"col-span-12 group [\u0026:not(:first-child)]:mt-xl [\u0026:not(:last-child)]:mb-xl\",\"children\":[\"$\",\"$2e\",null,{\"fallback\":null,\"children\":[[\"$\",\"$L48\",null,{\"moduleIds\":\"$undefined\"}],[\"$\",\"figure\",null,{\"className\":\"@container max-w-container grid w-full grid-cols-12\",\"children\":[\"$\",\"div\",null,{\"className\":\"gap-sm col-span-12 flex min-h-0 flex-col overflow-hidden @md:col-span-6 @md:col-start-4\",\"children\":[[\"$\",\"div\",null,{\"className\":\"gap-sm @sm:flex-row flex min-h-0 w-full min-w-0 flex-col items-start\",\"children\":[[\"$\",\"$L49\",\"1iKkLeg4Ef5qkjY34RDnQ2\",{\"asset\":{\"title\":\"ginkgo \u003e figure (AI-driven autonomous lab) \u003e media \u003e asset (desktop light)\",\"description\":\"\",\"file\":{\"url\":\"//images.ctfassets.net/kftzwdyauwt9/2TbblhnZK2vp1IFVnn8KaY/502e325bb6b8996c9f5e91d6e93e783e/AI-driven_autonomous_lab___light_mode.png\",\"details\":{\"size\":87800,\"image\":{\"width\":1192,\"height\":1118}},\"fileName\":\"AI-driven autonomous lab _ light mode.png\",\"contentType\":\"image/png\"}},\"altText\":\"Diagram titled AI-driven autonomous lab. GPT-5 performs data analysis, biochemical reasoning, and hypothesis generation, sending experimental designs to Reconfigurable Automation Carts (RACs), which execute physical experiments, automate liquid handling, incubate samples, and measure fluorescence. RACs return experimental data and metrics back to GPT-5, forming a closed feedback loop.\",\"assetMobile\":{\"title\":\"ginkgo \u003e figure (AI-driven autonomous lab) \u003e media \u003e asset (mobile light)\",\"description\":\"\",\"file\":{\"url\":\"//images.ctfassets.net/kftzwdyauwt9/2Vn3A10tDvGP4h8YVRARsf/11c2b2317d88682e1bd5812bde384acd/AI-driven_autonomous_lab___light_mode___mobile.png\",\"details\":{\"size\":136119,\"image\":{\"width\":800,\"height\":1766}},\"fileName\":\"AI-driven autonomous lab _ light mode _ mobile.png\",\"contentType\":\"image/png\"}},\"assetDark\":{\"title\":\"ginkgo \u003e figure (AI-driven autonomous lab) \u003e media \u003e asset (desktop dark)\",\"description\":\"\",\"file\":{\"url\":\"//images.ctfassets.net/kftzwdyauwt9/3z54aPOLfMTJapvIeZEhcV/056528ad0ee65b8aca59e83c09985586/AI-driven_autonomous_lab___dark_mode.png\",\"details\":{\"size\":76363,\"image\":{\"width\":1192,\"height\":1118}},\"fileName\":\"AI-driven autonomous lab _ dark mode.png\",\"contentType\":\"image/png\"}},\"assetDarkMobile\":{\"title\":\"ginkgo \u003e figure (AI-driven autonomous lab) \u003e media \u003e asset (mobile dark)\",\"description\":\"\",\"file\":{\"url\":\"//images.ctfassets.net/kftzwdyauwt9/73vpcrx6nVMBS4ImevBRGM/1493259499887a13badd26adbee75265/AI-driven_autonomous_lab___dark_mode___mobile.png\",\"details\":{\"size\":104385,\"image\":{\"width\":800,\"height\":1766}},\"fileName\":\"AI-driven autonomous lab _ dark mode _ mobile.png\",\"contentType\":\"image/png\"}},\"videoShowMuteButton\":true,\"useVimeoControls\":false,\"showEmbeddedVideoControls\":false,\"captionAlignment\":\"content-grid\",\"truncateCaption\":true,\"centerCaption\":false,\"copyToClipboard\":false,\"keyline\":false,\"id\":\"1iKkLeg4Ef5qkjY34RDnQ2\",\"__typename\":\"mediaItem\"}]]}],[\"$\",\"figcaption\",null,{\"className\":\"text-caption gap-3xs col-span-12 flex w-full flex-col items-center\",\"children\":[\"$\",\"$L4a\",null,{\"caption\":{\"data\":{},\"content\":[{\"data\":{},\"content\":[{\"data\":{},\"marks\":[{\"type\":\"italic\"}],\"value\":\"GPT-5 designed batches of experiments in a standard 384-well plate format, and ran them on Ginkgo Bioworks cloud laboratory. Once the experiments finished, the cloud laboratory pushed the data back to GPT-5, where the model analyzed the outcomes, generated new hypotheses, and designed the next round of experiments.\",\"nodeType\":\"text\"}],\"nodeType\":\"paragraph\"}],\"nodeType\":\"document\"},\"lineClamp\":\"line-clamp-2\",\"fullWidthCaption\":true}]}]]}]}]]}]}],[\"$\",\"div\",\"16\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"To keep the loop grounded in what an autonomous lab can do, we added strict programmatic validation before any experiment ran. That validation enforced that AI-designed experiments were physically executable on the automation platform. It prevented paper experiments that look plausible in text but cant be carried out in a robotic workflow.\"]}]]}]]}]}],[\"$\",\"div\",\"17\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"Across the full run, the system executed more than 36,000 CFPS reactions across 580 automated plates. This scale matters because its what lets patterns emerge. In biology, single experiments are noisy. Throughput and iteration are how you separate signal from random noise. Once GPT5 had access to the relevant paper and tools, it took three rounds of experimentation and two months to establish a new state of the art: 40% lower protein production cost compared to the \"]}]]}],[\"$\",\"$L2f\",\"1\",{\"href\":\"https://www.biorxiv.org/content/10.1101/2025.08.01.668204v1.article-info\",\"external\":true,\"className\":\"text-primary-100 hover:text-primary-60 relative underline-offset-[0.25rem] decoration-1 underline\",\"children\":[[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"best prior baseline\"]}]]}]],\"\"]}],[\"$\",\"$46\",\"2\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\".\"]}]]}]]}]}],[\"$\",\"div\",\"18\",{\"className\":\"col-span-12 group [\u0026:not(:first-child)]:mt-xl [\u0026:not(:last-child)]:mb-xl\",\"children\":[\"$\",\"$2e\",null,{\"fallback\":null,\"children\":[[\"$\",\"$L48\",null,{\"moduleIds\":\"$undefined\"}],[\"$\",\"figure\",null,{\"className\":\"@container max-w-container grid w-full grid-cols-12\",\"children\":[\"$\",\"div\",null,{\"className\":\"gap-sm col-span-12 flex min-h-0 flex-col overflow-hidden @md:col-span-6 @md:col-start-4\",\"children\":[[\"$\",\"div\",null,{\"className\":\"gap-sm @sm:flex-row flex min-h-0 w-full min-w-0 flex-col items-start\",\"children\":[[\"$\",\"$L49\",\"1SqGBxe83el5wBRR23fDHx\",{\"altText\":\"Gingko video figure \",\"videoEmbedUrl\":\"https://player.vimeo.com/video/1161924841?h=5f236dd4e2\u0026amp;badge=0\u0026amp;autopause=0\u0026amp;player_id=0\u0026amp;app_id=58479\",\"ratio\":\"4:3\",\"ratioMobile\":\"4:3\",\"videoLoop\":true,\"videoAutoPlay\":true,\"videoShowMuteButton\":false,\"showVideoControls\":false,\"useVimeoControls\":false,\"showEmbeddedVideoControls\":false,\"captionAlignment\":\"content-grid\",\"truncateCaption\":true,\"centerCaption\":false,\"copyToClipboard\":false,\"keyline\":false,\"id\":\"1SqGBxe83el5wBRR23fDHx\",\"__typename\":\"mediaItem\"}]]}],[\"$\",\"figcaption\",null,{\"className\":\"text-caption gap-3xs col-span-12 flex w-full flex-col items-center\",\"children\":[\"$\",\"$L4a\",null,{\"caption\":{\"data\":{},\"content\":[{\"data\":{},\"content\":[{\"data\":{},\"marks\":[{\"type\":\"italic\"}],\"value\":\"Ginkgo Bioworks reconfigurable automation carts. Credit: Ginkgo Bioworks\",\"nodeType\":\"text\"}],\"nodeType\":\"paragraph\"}],\"nodeType\":\"document\"},\"lineClamp\":\"line-clamp-2\",\"fullWidthCaption\":true}]}]]}]}]]}]}],[\"$\",\"div\",\"19\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-xl\",\"children\":[\"$\",\"$L47\",null,{\"text\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"What we learned\"]}]]}]],\"headlineTag\":\"h2\",\"headlineStyleDefault\":\"Heading 3\",\"id\":\"what-we-learned\",\"omitFromTableOfContents\":false}]}],[\"$\",\"div\",\"20\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"We found that the improvements came from identifying combinations that work well together and that hold up in the realities of high-throughput automation.\"]}]]}]]}]}],[\"$\",\"div\",\"21\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"We found that GPT5 identified low-cost reaction compositions that humans had not previously tested in this configuration. Cell-free protein synthesis (CFPS) has been studied for years, but the space of possible mixtures is still large. When you can propose and execute thousands of combinations quickly, you can find workable regions that are easy to miss with a manual workflow.\"]}]]}]]}]}],[\"$\",\"div\",\"22\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"We also found that high-throughput, plate-based experiments often differ from manual, bench-top experiments. Oxygenation can be lower in high-throughput reaction formats. Mixing and geometry can be different. Most CFPS reactions produce much more protein in test tubes than in microtiter plates, because larger scales generally come with more oxygen availability and better mixing. In fact, for plate-based reactions at low volume, GPT5 proposed many reactions that out-performed the prior best immediately after getting access to a computer for data analysis and a web browser to search for relevant papers . Overall, GPT5 proposed many reagent combinations that performed well under high-throughput constraints, including many that are more robust in low-oxygen conditions common in automated lab settings.\"]}]]}]]}]}],[\"$\",\"div\",\"23\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"In addition, we found that small changes in buffering, energy regeneration components, and polyamines had an outsized impact relative to their cost. These are not always the first parameters people reach for, but at high throughput, they become testable hypotheses rather than background assumptions.\"]}]]}]]}]}],[\"$\",\"div\",\"24\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-sm\",\"children\":[\"$\",\"p\",null,{\"className\":\"mb-sm last:mb-0\",\"children\":[[\"$\",\"$46\",\"0\",{\"children\":[[\"$\",\"span\",\"text-end-0\",{\"children\":[\"Finally, the cost structure itself shaped what mattered. In CFPS, costs are now dominated by lysate and DNA. That means yield is the highest-leverage strategy. If you can boost protein output per unit of expensive input, you make meaningful progress on cost even before you chase marginal savings elsewhere.\"]}]]}]]}]}],[\"$\",\"div\",\"25\",{\"className\":\"@md:col-span-6 @md:col-start-4 col-span-12 max-w-none [\u0026:not(:first-child)]:mt-
